class Solution {
  int numberOfWays(String s, String t, int k) {
    final int mod = 1000000007;
    int n = s.length;
    if (s == t) {
      if (k == 1) return 0;
      if (k % 2 == 0) return (n - 1) * 2 % mod;
      return (k > 1) ? (n - 1) * 2 % mod : 0;
    } else {
      if (k == 1) return 0;
      Map<int, int> count = {};
      for (int i = 0; i < n; ++i) {
        if ((s + s).substring(i + 1, i + 1 + n) == t) {
          count[i + 1] = (count[i + 1] ?? 0) + 1;
        }
      }
      int res = 0;
      for (int len in count.keys) {
        if ((k - 1) % 2 == 0 && len % n != 0) {
          res = (res + count[len]!) % mod;
        }
      }
      return res;
    }
  }
}
